import React from 'react';
import './GameComponent.css'
import { Hole } from '.../Components/HoleComponent/HoleComponent';

export class Game extends React.Component{

    render(){
        var _ = require('lodash');
        const arrayOfNumbers = _.range(1,this.props.numberOfHoles+1);
        console.log(arrayOfNumbers)
        return (
            <div className="game">
                {arrayOfNumbers.map((number)=>{
                    <Hole key={number}/>
                })}

            </div>

        );

    }

}
